import React, { Component } from 'react';

class BballInfo extends Component {

  render() {
    return (
      <div className="container">
      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSvjVLNaSfhgqIY2r3nL_gDMkmb2S2fYUXJmllTjg5GiGd8N236-Q"/>
      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRNp5a68S-YT2K_BNdHOz3-kJOeuFBZF7Qj8FrXib8iilJbpgeG"/>
      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQdQYj-TwVfMlV0U7ulqztUtKdxSaIETr418e1d2lBZCRaqbqQ4"/>
      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSaUarOdHfmsZhaleae5UJ4QfnZ_RoHVZ0CuCDW4DZqtTVrsvt-"/>
      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQu5LcaTucPU7NNuc7QD8wiUVdw042ck_JUSswYRoWjUW-UT1b_yQ"/>
      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQeqUe1GAOzcQgaDujdGOf_X0hEpPtvXiYV-IHohN5DQyHDgvPe"/>
      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT1OS9x6Xa0T6lMcu2OYoiLBH20gNSgSN0gVHL3GFtdtdA4nNu3"/>
      <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSmoLwLdRynyzk69X3HlYxnHLgTBgzeMma_iJqBRdMJtmpJ-fvQ0g"/>
      </div>
    );
  }

}

export default BballInfo;
